import React, { useEffect, useState } from "react";
import TravelLogList from "../components/TravelLogList";
import "./TravelLogs.css";

const TravelLogs = () => {
  const [travelLogs, setTravelLogs] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const response = await fetch("http://localhost:3001/api/travel-logs");
        if (!response.ok) {
          throw new Error("Failed to fetch travel logs.");
        }
        const data = await response.json();
        setTravelLogs(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setIsLoading(false);
      }
    };

    fetchLogs();
  }, []);

  if (isLoading) return <p>Loading...</p>;
  if (error) return <p>Error: {error}</p>;

  return (
    <div className="travel-logs-page">
      <h1>My Travel Logs</h1>
      <TravelLogList logs={travelLogs} />
    </div>
  );
};

export default TravelLogs;
